<html lang="es">
<head>
  <meta charset="utf-8" />
  <meta name="viewport" content="width=device-width,initial-scale=1" />
  <title>Tarjeta Regalo</title>
  <style>
    :root{--card-w:420px;--card-h:660px;--bg:#2f6b63;--accent:#b55;}
    html,body{height:100%;margin:0;font-family:Inter, system-ui, -apple-system, 'Segoe UI', Roboto, 'Helvetica Neue', Arial;display:flex;align-items:center;justify-content:center;background:linear-gradient(180deg,#efefef 0%, #dcdcdc 100%);}
    .wrap{display:flex;flex-direction:column;gap:18px;align-items:center}
    .card-scene{width:var(--card-w);height:var(--card-h);perspective:1200px}
    .card{overflow:visible;width:100%;height:100%;position:relative;transform-style:preserve-3d;transition:transform 700ms cubic-bezier(.2,.8,.2,1);cursor:pointer;border-radius:14px;box-shadow:0 14px 40px rgba(10,10,10,.25);}
    .card.flipped{transform:rotateY(180deg)}
    .side{position:absolute;inset:0;backface-visibility:hidden;border-radius:14px;overflow:hidden;display:flex;align-items:center;justify-content:center;background: transparent;}
    .side img{width:100%;height:100%;object-fit:fill;display:block;padding:0;margin:0;border-radius:14px;}
    .back{transform:rotateY(180deg)}


    @media (max-width:520px){:root{--card-w:320px;--card-h:520px}}
  </style>
</head>

  <script>
    // Elementos
    const card = document.getElementById('card');
    // Toggle flip
    function toggleFlip(){
      card.classList.toggle('flipped');
      const pressed = card.classList.contains('flipped');
      card.setAttribute('aria-pressed', pressed);
    }
    card.addEventListener('click', toggleFlip);

    // Key accessibility (Enter / Space)
    card.addEventListener('keydown', (e)=>{ if(e.key==='Enter'||e.key===' '){ e.preventDefault(); toggleFlip(); }});

    function drawImageToCanvas(imgElement, ctx, w, h){
      return new Promise((resolve, reject)=>{
        const img = new Image();
        // Si la imagen en el DOM ya es de origen local y sin CORS, podemos usar su src
        img.crossOrigin = 'anonymous';
        img.onload = ()=>{ ctx.drawImage(img,0,0,w,h); resolve(); };
        img.onerror = (e)=>{ reject(e); };
        img.src = imgElement.src;
      });
    }
  </script>
